(()=>{const o=JSON.parse(localStorage.fsm);let e=[],s=[],t=[],l=[],n=[];o.nodes.forEach(o=>{s.push(o.text),o.isAcceptState&&l.push(o.text)}),o.links.forEach(s=>{"StartLink"===s.type?t.push(o.nodes[s.node].text):s.text.split(/,\s?/).forEach(t=>{e.includes(t)||e.push(t),n.push([o.nodes[s.nodeA].text,t,o.nodes[s.nodeB].text])})}),console.log("Alphabet:"),console.log(e),console.log("States:"),console.log(s),console.log("Initial States:"),console.log(t),console.log("Final States:"),console.log(l),console.log("Transitions:"),console.log(n)})();
